import Navbar from './components/layout/Navbar'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <div className="App">
    <Router>
      <Navbar /> 
      <Switch>
        <Route exact path= '/' component={Home} />
      </Switch>
    </Router>

    </div>
  );
}

export default App;
